    true,nt"url": null,nt"notes": "ML2H2O is the EOS Aura Microwave Limb Sounder
    (MLS) standard product for water vapor derived from radiances measured primarily
    by the 190 GHz radiometer. The current version is 4.2. Spatial coverage is near-global
    (-82 deg. to +82 deg. latitude), with each profile spaced 1.5 deg. or ~165 km along
    the orbit track (roughly 15 orbits per day). The recommended useful vertical range
    is between 316 and 0.00215 hPa, and the vertical resolution is about 1.5 km at 316
    hPa increasing to 3.5 km to 4.64 hPa, and degrades to 15 km above 0.1 hPa. Users
    of the ML2H2O data product should read section 3.9 of the EOS MLS Level 2 Version
    4 Quality Document for more information (http://mls.jpl.nasa.gov/data/v4-2_data_quality_document.pdf).nn
               Users are encouraged to register with the MLS science team at https://mls.jpl.nasa.gov/forms/reguser.php
    to obtain updates and information about this data product.nn            The data
    are stored in the version 5 EOS Hierarchical Data Format (HDF-EOS5), which is based
    on the version 5 Hierarchical Data Format, or HDF5. Each file contains two swath
    objects (one with profile data, the other with column data), each with a set of
    data and geolocation fields, swath attributes, and metadata. The data fields include
    the geophysical parameter values and precision (standard deviation), convergence
    values, data quality, and a status flag. The geolocation fields include a time stamp
    in TAI-93 format (seconds since January 1, 1993), geodetic latitude and longitude,
    and pressure level values, as well as local solar time, solar zenith angle, line
    of sight angle, and orbit geodetic angle. There is one file per day.",nt"owner_org":
